CREATE MATERIALIZED VIEW stream_query AS SELECT (max((INT '101')) FILTER(WHERE (false)) >> t_1.c2) AS col_0, t_1.c3 AS col_1, t_1.c15 AS col_2, t_1.c3 AS col_3 FROM m2 AS t_0 JOIN alltypes1 AS t_1 ON t_0.col_1 = t_1.c6 GROUP BY t_1.c4, t_0.col_0, t_1.c8, t_1.c11, t_1.c15, t_1.c3, t_1.c2, t_1.c13;
DROP MATERIALIZED VIEW IF EXISTS stream_query;
CREATE MATERIALIZED VIEW stream_query AS SELECT t_1.col_1 AS col_0, false AS col_1 FROM alltypes2 AS t_0 RIGHT JOIN m4 AS t_1 ON t_0.c7 = t_1.col_1 AND (t_0.c10 <= t_0.c13) WHERE false GROUP BY t_1.col_1, t_0.c16, t_0.c9 HAVING (coalesce(NULL, NULL, NULL, NULL, NULL, false, NULL, NULL, NULL, NULL));
DROP MATERIALIZED VIEW IF EXISTS stream_query;
CREATE MATERIALIZED VIEW stream_query AS SELECT (SMALLINT '-32768') AS col_0 FROM bid AS t_0 JOIN m7 AS t_1 ON t_0.auction = t_1.col_0 AND ((SMALLINT '581') = (INT '2147483647')) WHERE true GROUP BY t_0.date_time, t_0.price, t_0.channel HAVING false;
DROP MATERIALIZED VIEW IF EXISTS stream_query;
CREATE MATERIALIZED VIEW stream_query AS SELECT (hop_0.c8 + (INT '747')) AS col_0, (hop_0.c3 + DATE '2022-01-08') AS col_1, ((FLOAT '-2147483648')) AS col_2, ((REAL '1') * (REAL '-1884200002')) AS col_3 FROM hop(alltypes2, alltypes2.c11, INTERVAL '86400', INTERVAL '6739200') AS hop_0 GROUP BY hop_0.c11, hop_0.c3, hop_0.c9, hop_0.c6, hop_0.c5, hop_0.c15, hop_0.c13, hop_0.c8 HAVING CAST((CASE WHEN true THEN CAST(false AS INT) ELSE hop_0.c3 END) AS BOOLEAN);
DROP MATERIALIZED VIEW IF EXISTS stream_query;
